import React from 'react';
import './Page1.css';

const Page1 = ({ onNext }) => {
  return (
    <div className="page-container">
      <button className="power-button" onClick={onNext}>
        &#x23FB; {/* Unicode character for the power symbol */}
      </button>
      <h1 className="header-text">Hello [user],</h1>
      <p className="subheader-text">What do you feel today?</p>
      <input 
        type="text" 
        className="input-field" 
        onClick={onNext} 
        placeholder="T" 
      />
    </div>
  );
};

export default Page1;
